⠀
Our dear Elizabeth has crossed the threshold from this time to eternity. ⠀
⠀
I wasn't sure if this was a right place to share my grief, but since I had shared with those of you who are on my newsletter mailing list last summer about Elizabeth's sudden sickness, I decided to welcome you & this online community to be part of my/our shared grief (or perhaps to witness my grief). ⠀
⠀
Elizabeth was very ill for the past few months, and I had already gone through waves of deep sorrow and grief, and yet, there are new tears to cry. ⠀
⠀
On Tuesday (the day of her passing) I set up this little altar in honor of Elizabeth's memory and celebration of her life. ⠀
⠀
I lit the candles and listened to a song that she sang at our last silent retreat together that I got to lead with her 3 years ago. ("Stil, Mijn Ziel Wees Stil"). ⠀
⠀
My heart is full of gratitude for our friendship (the photo of us together at my wedding), the way she celebrated the sacredness of life (sunflowers), and the gift of ears she offered to me, and showed me how to give to others (the shell on the altar). (Elizabeth was my first spiritual director, then  my teacher in spiritual direction, and most recently a supervisor.)⠀
 ⠀
I might bake a banana bread this weekend following Elizabeth's recipe, watch the first autumn leaves fall down, and cry some more tears. ⠀
⠀
Every season is sacred. 🍁🎈⠀
⠀
She is home now. ⠀
⠀
And, finally she gets to embrace her Jesus in the way that the rest of us can only dream about. ⠀
 ⠀
